package com.dilidili.of.entity;import java.util.List;public class Recommend_data extends BaseBean{	private List<Banner_data> banner_data;	private List<Lives> lives;	private Partition partition;	public List<Banner_data> getBanner_data() {		return this.banner_data;	}	public void setBanner_data(List<Banner_data> banner_data) {		this.banner_data = banner_data;	}	public List<Lives> getLives() {		return this.lives;	}	public void setLives(List<Lives> lives) {		this.lives = lives;	}	public Partition getPartition() {		return this.partition;	}	public void setPartition(Partition partition) {		this.partition = partition;	}	public String toString() {		return "Recommend_data [banner_data = " + banner_data + ", lives = " + lives + ", partition = " + partition + "]";	}}